import React from 'react';

const BoxSisu2 = (props) => {
    const style = {
        backgroundColor: props.on ? "red" : "green",
        color: props.on ? "black" : "white"
    }

    return (
        <div
            style={style}
            onClick={() => props.vajuta(props.id)}
        >
            {props.time} {/* Only displaying the time */}
        </div>
    );
}

export default BoxSisu2;
